import React from 'react';
import styles from './detail_section.module.css'
import classnames from 'classnames';
const DetailSection = (props) => {
    return (
        <div className={styles.detail_section}>
            <p className={classnames(styles.detail_section_p, style.detail_section_p_google)}> 700만 명의 여행자</p>
            <p className={styles.detail_section_p}>  100만 개의 여행 리뷰</p>
            <p className={styles.detail_section_p}>  470만 개의 여행 일정</p>
        </div>);
}
export default DetailSection;
